## Stage 1: Pretraining Pruned VAE Decoder

Prune the SD VAE decoder $\mathcal{D}_{\mathrm{SD}}$ to obtain $\mathcal{D}_{\text {pruned }}$;
Initialize $\mathcal{D}_{\text {pruned }}$ and a discriminator as in [43, 73];
for number of training iterations do
Sample a batch of images $\mathbf{x}$;
Obtain latent codes $\mathbf{z}=\mathcal{E}_{\mathrm{SD}}(\mathbf{x})$;
Reconstruct images $\hat{\mathbf{x}}=\mathcal{D}_{\text {pruned }}(\mathbf{z})$;
Compute reconstruction loss [73] of $\mathbf{x}$ and $\hat{\mathbf{x}}$;
Update $\mathcal{D}_{\text {pruned }}$ using Adam optimizer;
Compute discriminator loss [73] of $\mathbf{x}$ and $\hat{\mathbf{x}}$;
Update discriminator using Adam optimizer;

## Stage 2: Adversarial Distillation

Prune the SD UNet $\epsilon_{\mathrm{SD}}$ to obtain $\epsilon_{\text {pruned }}$;
Initialize the student model using $\epsilon_{\text {pruned }}$ and $\mathcal{D}_{\text {pruned }}$;
Initialize a feature-space discriminator using $\epsilon_{\mathrm{SD}}$;
for number of training iterations do
Sample a batch of LR-HR pairs $\left(\mathbf{x}_{\mathrm{LR}}, \mathbf{x}_{\mathrm{HR}}\right)$;
Compute features $\mathbf{f}_{\text {student }}$ from student model;
Compute features $\mathbf{f}_{\text {teacher }}$ from teacher model;
Compute distillation loss:

$$
\mathcal{L}_{\text {distill }}=\left\|\mathbf{f}_{\text {student }}-\mathbf{f}_{\text {teacher }}\right\|_{1}
$$

Compute adversarial loss:

$$
\mathcal{L}_{\text {adv }}=\text { Softplus }\left(-\text { Discriminator }\left(\mathbf{f}_{\text {student }}\right)\right)
$$

Compute total loss: $\mathcal{L}=\mathcal{L}_{\text {distill }}+\lambda_{\text {adv }} \mathcal{L}_{\text {adv }}$;
Update student model using Adam optimizer;
Compute features $\mathbf{f}_{\text {GT }}$ using $\mathbf{x}_{\mathrm{HR}}$;
Compute discriminator loss:

$$
\begin{aligned}
\mathcal{L}_{\text {disc }} & =\text { Softplus }\left(\text { Discriminator }\left(\mathbf{f}_{\text {student }}\right)\right) \\
& +\text { Softplus }\left(-\text { Discriminator }\left(\mathbf{f}_{\text {GT }}\right)\right)
\end{aligned}
$$

Update discriminator using Adam optimizer;
